script: |
  super -f tsv -I q3232.sql | sort > q3232.out

vector: true

inputs:
  - name: q3232.sql
    data: |
      SELECT DISTINCT tab1.col1 * 78 AS col2 FROM tab1, tab2 cor0, tab0 AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q3232.out
    data: |
      1014
      2028
      780
